text:
An artist who endured severe mental health problems brightened the lives of cat lovers everywhere. #LouisWain

@stuartmwrites 

https://t.co/SMnik3oWsS

@talkingcl That’s great news, Stephen. You have so much to offer.

The project sounds very interesting and I’d be keen to have some info about it, if you have a minute to drop me a link or some background. No rush, though. 

I hope your meetings go well. ❤️

@wallywookie Whoa! That equates to a Cat 6 in my book. 

No point trying to sneak anything past you, is there?  

Pax. 🌹💫🐾💪💚

@wallywookie Your name is Walter Wilson and you are one of the most adorable and inspirational people I know.

I just wish it didn’t hurt as much as it does. 

💚✨💚

@jakanoo1234 🤗

Honestly, even you don’t have to apologise for being alive. 😉

How are you doing today?

@HerreMorker SO important for people to be aware of this. 🚨

It’s natural to assume a Twitter report will ensure help is activated but it can actually make things worse. 

Thank you for flagging this. It needs to be highlighted regularly.

@AlcoholicDad4 I’ve done London-St Ives in just under 4 hours, without any comfort breaks, before speed cameras were so prolific obvs. It can be a total lottery, but maybe choosing a Friday afternoon was a clue, lol. 

Even so, I’m not a fan of the proposed tunnel.

Enjoy now you’re there. 🏖🤗

@wallywookie @amazon STAHHP! I see you, I love you, I appreciate you beyond imagining, but please don’t.

No I don’t have a coffee grinder because I would use it once and it would go to the back of the cupboard and never see the light of day.

I can be such a disappointment. 😫 xxx

@wallywookie You would be a wonderful Tibetan monk, but I appreciate that is not the desired objective.

I’m so sorry you are having to relinquish this particular source of relief. 

Life’s a fucking bitch but it’s good to know you were able to get immediate help. Beeg hugs. 💚

@Asilentpoet1 Wow! That is stunning. Lovely to see your amazing talents finding expression. There are no boundaries. 

That’s a great collection. Love the photo too.

Hope things are good in general. ❤️

@DiarySociopath Not idiotic at all.

Getting the vaccine, as with all the precautions, is about protecting others as well as yourself.

Surviving Covid isn’t just about not dying. Long Covid is life changing and it’s predicted this will ultimately be the most significant legacy of the pandemic.

@wallywookie YESSS! 

Wowser. 

💚💪💚  💫🔥☄️💥💫

@BillyBo58678428 @Sail270west Never hiding, Billy. Never unaware. I just run out of catch up time every now and then. 🥵

You will always have a special place in my heart and I am never more than a DM away.

Sending big love. ❤️

@wallywookie Aawww 🤗 

Missing those dimples already.

🤭 :oops:

@wallywookie Turning off the NOISE is not only wise, it is ESSENTIAL self preservation right now.

Silence allows us to hear only what is important. 

(Your time will come)

@wallywookie @DiarySociopath Ouchies! Been there more than once. 

There is only one immutable rule for a Wookie in these circumstances. FFS sake don’t hit your HEAD. 

Since you appear to have avoided that happenstance I shall content myself with administering long distance hugs, while awaiting news. 🤗👣🤗
